import './App.css';
import React from 'react';
import { Switch,Route,Link } from 'react-router-dom'

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <div className="left">
          <ul class="nav nav-tabs">
            <li class="nav-item">
              <Link class="nav-link active" to="/question-1">Q1</Link>
            </li>
          </ul>
        </div>
        <div className="right">
          <p>Direita</p>

        </div>
      </div>
    );
  }
}

export default App;
